import React from 'react';
import Modal from '../../common/Modal';
import apiConfig from '../../api.config';
import TextInput from '../../common/TextInput';

import './index.scss';

const Photos = props => {
  const { photoList: { photos: { photo = [] } = {} } = {}, isOpen, handleSearch, onPhotoClick, onModalClose } =
    props || {};

  const {
    getImage: { url: getImageURL }
  } = apiConfig;
  return (
    <div className="photos-container">
      <div className="photo-search-container">
        <h3 className="photo-list-heading">Search Photos</h3>
        <TextInput classname="photo-search-input" handleSearch={handleSearch} />
      </div>
      <div className="photo-results">
        <ul>
          {photo.map(({ id, server, secret, title }) => (
            <li key={id}>
              <img src={`${getImageURL}/${server}/${id}_${secret}_w.jpg}`} alt={title} />
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};
export default Photos;
